import React from "react";

function Home() {
  return (
    <>
      <div className="unlogged-nav-bar">
        <div className="nav-button log-in"><p>Log In</p></div>
        <div className="nav-button sign-up"><p>Sign Up</p></div>
        <div className="nav-icon settings"><p>Settings</p></div>

      </div>
      <h1>The Forest</h1>
    </>
  )
}

export default Home
